import React from 'react';

const ItemsList = (props) => {
    console.log(props.images);
    return (
        <>
            {[props].map((image, index) =>
            (
                <div>
                    <img src={image.previewURL} alt='img'> </img>
                </div>
            )
            )}
        </>
    );
};
export default ItemsList;
